<?php

namespace Database\Seeders;

use App\Models\FontAwesomeGlyph;
use Illuminate\Database\Seeder;
use Illuminate\Support\Arr;
use Illuminate\Support\Collection;

class Glyphs extends Seeder
{
    /**
     * Populate sample glyphs to use in the workbench.
     *
     * @return void
     */
    public function run()
    {
        static::getSampleGlyphs()
            ->each(function ($glyph) {
                FontAwesomeGlyph::firstOrNew(
                    Arr::only($glyph, ['id', 'style'])
                )->forceFill($glyph)
                    ->save();
            });
    }

    public static function getSampleGlyphs(): Collection
    {
        return collect(
            json_decode(static::getSampleGlyphJSON(), true)
        );
    }

